import React from 'react'

const Footer = () => {
  return (
    <footer className="bg-gray-800 py-4">
      <div className="container mx-auto px-4 text-center text-white">
        <p>&copy; 2023 Your Company. All rights reserved.</p>
      </div>
    </footer>
  )
}

export default Footer
